BEGIN TRANSACTION;
CREATE TABLE price_data (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            symbol_id INTEGER,
            date DATE,
            open REAL,
            high REAL,
            low REAL,
            close REAL,
            volume REAL,
            UNIQUE(symbol_id, date)
        );
CREATE TABLE symbols (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            symbol TEXT UNIQUE,
            name TEXT,
            type TEXT,
            region TEXT
        );
CREATE INDEX idx_symbol ON symbols(symbol);
CREATE INDEX idx_symbol_id ON price_data(symbol_id);
CREATE INDEX idx_date ON price_data(date);
CREATE INDEX idx_symbol_date ON price_data(symbol_id, date);
DELETE FROM "sqlite_sequence";
COMMIT;
